import React, {Component} from "react";
import {withRouter} from "react-router-dom";

class Dailysignin extends Component {
    constructor() {
        super();
        this.state = {}
    }
    add=()=>{
        this.props.history.push("/sosodail")
    }
    render() {
        return (<div className={"sosodail"}>
            <img alt={"标本"} onClick={this.add} className={"sosoimg"} src={"https://image.hongbeibang.com/Ftas3mziKsE3fMQvZ3jC4YgDugVk?80X80&imageView2/1/w/80/h/80"} />
            <p className={"sosobtn"} onClick={this.add}>视频教程</p>
        </div>)
    }

}

export default withRouter(Dailysignin);
